import React from "react";

const beautifulScreen = ({ result, setResult, calc, setCalc }) => {
	return (
		<div className="BeautifulScreen">
			<form>
				<input type="text" value={result} setResult={setResult} />
				<input type="text" value={calc} onChange={setCalc} />
			</form>
		</div>
	);
};

export default beautifulScreen;
